В объеме  потребления  в домашних  хозяйствах  основных  продуктов  питания  учитываются : 
мясо  различных  видов  животных , субпродукты , мясные  продукты  в пересчете  на мясо ; 
молоко  и молочные  продукты  (масло  животное , сыр, сливки , сметана , творог , мороженое , 
молочные  консервы , сухое  молоко  и тому  подобное ) в пересчете  на молоко ; 
рыба  и рыбопродукты  (рыба  сушеная  и вяленая , рыбные  консервы , икра, рыбные  полуфабрикаты  
и морепродукты ) в пересчете  на рыбу ; 
хлеб  и хлебопродукты , мука , крупа  и макаронные  изделия  в пересчете  на муку ; 
яйца  домашней  птицы , яичный  порошок , меланж  в пересчете  на яйца ; 
картофель , овощи  и продовольственные  бахчевые  культуры , фрукты  и ягоды  свежие , 
сушеные , соленые , маринованные , консервированные  и другие  в пересчете  на свежие .

